import React from 'react'
import UpdateProduct from '../components/UpdateProduct'

const UpdateProducts = () => {
  return (
    <div>
      <h1 className="text-center">Update Product</h1> 
      <UpdateProduct/>
      
    </div>
  )
}

export default UpdateProducts
